pragma solidity ^0.5.0;

import "./SurveyWallet.sol";

contract SurveyRequest is SurveyWallet {
    // uint256[] tempList;

    /**
    * @dev create Survey(public)
    * _CreateProduct() 
    *          
    *    
    *   false  
    * @param _maximumCount      .
    * @param _startedAt   .
    * @param _questionCount   .
    * @return A bool    
    */
    function requestSurvey(
        uint256 _maximumCount,
        uint256 _startedAt,
        uint8   _questionCount
        // bytes32 _hashData
    ) 
        public
        returns (uint256)
    {
        // 1.   
        uint256 allPrice = uint256(_questionCount) * uint256(PRICE_PER_QUESTION) * uint256(_maximumCount);
        uint256 requestPrice = allPrice * 80 / 100 ;
        uint256 rewardPirce = requestPrice / _maximumCount * 80 / 100;
        // 2.   
        bool isSuccess = _tranferTokenFromUserToThis(allPrice);
        _transferTokenFromThisToDeveloper(allPrice - requestPrice);

        if(isSuccess) {
            // 3.  
            uint256 newSurveyId = _createSurvey(
                requestPrice, 
                0,
                rewardPirce,
                _maximumCount,
                0,
                _startedAt,
                _questionCount, 
                false
            );
            // 3.1   
            addSubscriber(newSurveyId, msg.sender);
            // 4.  
            uint256 newReceiptId = _createReceipt(
                ReceiptTitles.Survey, 
                ReceiptMethods.Request, 
                address(this), 
                msg.sender,
                newSurveyId,
                requestPrice,
                _startedAt
            );
            return newReceiptId;
        }else {
            revert();
        }

    }

    /**
    * @dev     
    * @param _surveyId  Sotrage    
    * @return A uint256    DB primary key  
    */
    function getSurveyRequestDetail(uint256 _surveyId) 
        public
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint8,
            bool
        )
    {
        Survey memory survey = surveys[_surveyId];
        return (
            survey.requestPrice,
            survey.sellPrice,
            survey.rewardPrice,
            survey.maximumCount,
            survey.currentCount,
            survey.startedAt,
            survey.questionCount,
            survey.isSell
        );
    }

